Technically, this L1 smart contract acts as a connector between Ethereum (L1) and ZK Chain (L2). It checks the validity proof and data availability, handles L2 <-> L1 communication, finalizes L2 state transition, and more. There are also important contracts deployed on the L2 that can also execute logic called system contracts . Using L2 <-> L1 communication can affect both the L1 and the L2. diamondProxy.png DiamondProxy The main contract uses EIP-2535 diamond proxy pattern. It is an in-house implementation that is inspired by the mudgen reference implementation . It has no external functions, only the fallback that delegates a call to one of the facets (target/implementation contract). So even an upgrade system is a separate facet that can be replaced. One of the differences from the reference implementation is access freezability. Each of the facets has an associated parameter that indicates if it is possible to freeze access to the facet. Privileged actors can freeze the diamond (not a specific facet!) and all facets with the marker isFreezable should be inaccessible until the governor or admin unfreezes the diamond. Note that it is a very dangerous thing since the diamond proxy can freeze the upgrade system and then the diamond will be frozen forever. The diamond proxy pattern is very flexible and extendable. For now, it allows splitting implementation contracts by their logical meaning, removes the limit of bytecode size per contract and implements security features such as freezing. In the future, it can also be viewed as EIP-6900 for zkStack , where each ZK Chain can implement a sub-set of allowed implementation contracts. GettersFacet Separate facet, whose only function is providing view and pure methods. It also implements diamond loupe which makes managing facets easier. This contract must never be frozen. AdminFacet This facet responsible for the configuration setup and upgradability, handling tasks such as: Privileged Address Management: Updating key roles, including the governor and validators. System Parameter Configuration: Adjusting critical system settings, such as the L2 bootloader bytecode hash, verifier address, changing DA layer or fee configurations. Freezability: Executing the freezing/unfreezing of facets within the diamond proxy to safeguard the ecosystem during upgrades or in response to detected vulnerabilities. Control over the AdminFacet is divided between two main entities: Chain Type Manager - Separate smart contract that can perform critical changes to the system as protocol upgrades. For more detailed information on its function and design, refer to this document . Although currently only one version of the CTM exists, the architecture allows for future versions to be introduced via subsequent upgrades. The owner of the CTM is the decentralized governance , while for non-critical an Admin entity is used (see details below). Chain Admin - Multisig smart contract managed by each individual chain that can perform non-critical changes to the system such as granting validator permissions. MailboxFacet The facet that handles L2 <-> L1 communication. The Mailbox performs three functions: L1  L2 Communication: Enables data and transaction requests to be sent from L1 to L2 and vice versa, supporting the implementation of multi-layer protocols. Bridging Native Tokens: Allows the bridging of either ether or ERC20 tokens to L2, enabling users to use these assets within the L2 ecosystem. Censorship Resistance Mechanism: Currently in the research stage. L1 -> L2 communication is implemented as requesting an L2 transaction on L1 and executing it on L2. This means a user can call the function on the L1 contract to save the data about the transaction in some queue. Later on, a validator can process it on L2 and mark it as processed on the L1 priority queue. Currently, it is used for sending information from L1 to L2 or implementing multi-layer protocols. Users pays for the transaction execution in the native token when requests L1 -> L2 transaction. NOTE : While user requests the transaction from L1, the initiated transaction on L2 will have such a msg.sender: address sender = msg.sender; if (sender != tx.origin) { sender = AddressAliasHelper.applyL1ToL2Alias(msg.sender); } where uint160 constant offset = uint160(0x1111000000000000000000000000000000001111); function applyL1ToL2Alias(address l1Address) internal pure returns (address l2Address) { unchecked { l2Address = address(uint160(l1Address) + offset); }
} For most of the rollups the address aliasing needs to prevent cross-chain exploits that would otherwise be possible if we simply reused the same L1 addresses as the L2 sender. In ZKsync Era address derivation rule is different from the Ethereum, so cross-chain exploits are already impossible. However, ZKsync Era may add full EVM support in the future, so applying address aliasing leaves room for future EVM compatibility. The L1 -> L2 communication is also used for bridging base tokens . If base token is ether (the case for ZKsync Era) - user should include a msg.value when initiating a transaction request on the L1 contract, if base token is an ERC20 then contract will spend users allowance. Before executing a transaction on L2, the specified address will be credited with the funds. To withdraw funds user should call withdraw function on the L2BaseToken system contracts. This will burn the funds on L2, allowing the user to reclaim them through the finalizeWithdrawal function on the SharedBridge (more in ZK Chain section). More about L1->L2 operations can be found here . L2 -> L1 communication, in contrast to L1 -> L2 communication, is based only on transferring the information, and not on the transaction execution on L1. The full description of the mechanism for sending information from L2 to L1 can be found here . The Mailbox facet also facilitates L1<>L2 communications for those chains that settle on top of Gateway. The user interfaces for those are identical to the L1<>L2 communication described above. To learn more about L1<>L2 communication works, check out this document and this one . ExecutorFacet A contract that accepts L2 batches, enforces data availability via DA validators and checks the validity of zk-proofs. You can read more about DA validators in this document . The state transition is divided into three stages: commitBatches - check L2 batch timestamp, process the L2 logs, save data for a batch, and prepare data for zk-proof. proveBatches - validate zk-proof. executeBatches - finalize the state, marking L1 -> L2 communication processing, and saving Merkle tree with L2 logs. Each L2 -> L1 system log will have a key that is part of the following: enum SystemLogKey { L2_TO_L1_LOGS_TREE_ROOT_KEY, PACKED_BATCH_AND_L2_BLOCK_TIMESTAMP_KEY, CHAINED_PRIORITY_TXN_HASH_KEY, NUMBER_OF_LAYER_1_TXS_KEY, PREV_BATCH_HASH_KEY, L2_DA_VALIDATOR_OUTPUT_HASH_KEY, USED_L2_DA_VALIDATOR_ADDRESS_KEY, EXPECTED_SYSTEM_CONTRACT_UPGRADE_TX_HASH_KEY
} When a batch is committed, we process L2 -> L1 system logs. Here are the invariants that are expected there: In a given batch there will be either 7 or 8 system logs. The 8th log is only required for a protocol upgrade. There will be a single log for each key that is contained within SystemLogKey Three logs from the L2_TO_L1_MESSENGER with keys: L2_TO_L1_LOGS_TREE_ROOT_KEY L2_DA_VALIDATOR_OUTPUT_HASH_KEY USED_L2_DA_VALIDATOR_ADDRESS_KEY Two logs from L2_SYSTEM_CONTEXT_SYSTEM_CONTRACT_ADDR with keys: PACKED_BATCH_AND_L2_BLOCK_TIMESTAMP_KEY PREV_BATCH_HASH_KEY Two or three logs from L2_BOOTLOADER_ADDRESS with keys: CHAINED_PRIORITY_TXN_HASH_KEY NUMBER_OF_LAYER_1_TXS_KEY EXPECTED_SYSTEM_CONTRACT_UPGRADE_TX_HASH_KEY None logs from other addresses (may be changed in the future). DiamondInit It is a one-function contract that implements the logic of initializing a diamond proxy. It is called only once on the diamond constructor and is not saved in the diamond as a facet. Implementation detail - function returns a magic value just like it is designed in EIP-1271 , but the magic value is 32 bytes in size.

286.body:
Priority queue is a data structure in Era contracts that is used to handle L1->L2 priority operations. It supports the following: inserting a new operation into the end of the queue checking that an newly executed batch executed some n first priority operations from the queue (and not some other ones) in correct order The queue itself only stores the following: struct PriorityOperation { bytes32 canonicalTxHash; uint64 expirationTimestamp; uint192 layer2Tip;
} of which we only care about the canonical hash. Inserting new operations The queue is implemented as a library . For each incoming priority operation, we simply pushBack its hash, expiration and layer2Tip. Checking validity When a new batch is executed, we need to check that operations that were executed there match the operations in the priority queue. The batch header contains numberOfLayer1Txs and priorityOperationsHash which is a rolling hash of all priority operations that were executed in the batch. Bootloader check that this hash indeed corresponds to all priority operations that have been executed in that batch. The contract only checks that this hash matches the operations stored in the queue: /// @dev Pops the priority operations from the priority queue and returns a rolling hash of operations
function _collectOperationsFromPriorityQueue(uint256 _nPriorityOps) internal returns (bytes32 concatHash) { concatHash = EMPTY_STRING_KECCAK; for (uint256 i = 0; i < _nPriorityOps; i = i.uncheckedInc()) { PriorityOperation memory priorityOp = s.priorityQueue.popFront(); concatHash = keccak256(abi.encode(concatHash, priorityOp.canonicalTxHash)); }
} bytes32 priorityOperationsHash = _collectOperationsFromPriorityQueue(_storedBatch.numberOfLayer1Txs);
require(priorityOperationsHash == _storedBatch.priorityOperationsHash); // priority operations hash does not match to expected As can be seen, this is done in O(n) compute, where n is the number of priority operations in the batch.

291.body:
L2L1 communication before Boojum While there were quite some changes during Boojum upgrade, most of the scheme remains the same and so explaining how it worked before gives some background on why certain decisions are made and kept for backward compatibility. L2L1 communication before Boojum The most important feature that well need to maintain in Boojum for backward compatibility is to provide a similar Merkle tree of L2L1 logs with the long L2L1 messages and priority operations status. Before Boojum, whenever we sent an L2L1 long message, a log was appended to the Merkle tree of L2L1 messages on L1 due to necessity. In Boojum well have to maintain this fact. Having the priority operations statuses is important to enable proving failed deposits for bridges. Changes with Boojum Problems with the previous approach There was a limit of 512 L2L1 logs per batch, which is very limiting. It causes our block to be forcefully closed based on the number of these messages instead of having the pubdata as the only limit. In the ideal world, we would like to have the tree adapt to the requirements of the batch, with any number of leaves possible (in practice, a maximum of 2048 would likely be enough for the foreseeable future). Extending the tree in the circuits will be hard to do and hard to maintain. The hash of the contents of the L2L1 messages needs to be rehashed to support the danksharding blobs, so we want to keep only the essential logs as parts of calldata and the rest should be separated so that they could be moved the EIP4844 blob in the future. Solution We will implement the calculation of the Merkle root of the L2L1 messages via a system contract as part of the L1Messenger. Basically, whenever a new log emitted by users that needs to be Merklized is created, the L1Messenger contract will append it to its rolling hash and then at the end of the batch, during the formation of the blob it will receive the original preimages from the operator, verify, and include the logs to the blob. We will now call the logs that are created by users and are Merklized user logs and the logs that are emitted by natively by VM system logs. Here is a short comparison table for better understanding: System logs User logs Emitted by VM via an opcode. VM knows nothing about them. Consistency and correctness is enforced by the verifier on L1 (i.e. their hash is part of the block commitment. Consistency and correctness is enforced by the L1Messenger system contract. The correctness of the behavior of the L1Messenger is enforced implicitly by prover in a sense that it proves the correctness of the execution overall. We dont calculate their Merkle root. We calculate their Merkle root on the L1Messenger system contract. We have constant small number of those. We can have as much as possible as long as the commitBatches function on L1 remains executable (it is the job of the operator to ensure that only such transactions are selected) In EIP4844 they will remain part of the calldata. In EIP4844 they will become part of the blobs. Backwards-compatibility Note, that to maintain a unified interface with the previous version of the protocol, the leaves of the Merkle tree will have to maintain the following structure: struct L2Log { uint8 l2ShardId; bool isService; uint16 txNumberInBlock; address sender; bytes32 key; bytes32 value;
} While the leaf will look the following way: bytes32 hashedLog = keccak256( abi.encodePacked(_log.l2ShardId, _log.isService, _log.txNumberInBlock, _log.sender, _log.key, _log.value)
); keccak256 will continue being the function for the merkle tree. To put it shortly, the proofs for L2L1 log inclusion will continue having exactly the same format as they did in the pre-Boojum system, which avoids breaking changes for SDKs and bridges alike. Implementation of L1Messenger The L1Messenger contract will maintain a rolling hash of all the L2ToL1 logs chainedLogsHash as well as the rolling hashes of messages chainedMessagesHash. Whenever a contract wants to send an L2L1 log, the following operation will be applied : chainedLogsHash = keccak256(chainedLogsHash, hashedLog). L2L1 logs have the same 88-byte format as in the current version of ZKsync. Note, that the user is charged for necessary future the computation that will be needed to calculate the final merkle root. It is roughly 4x higher than the cost to calculate the hash of the leaf, since the eventual tree might have be 4x times the number nodes. In any case, this will likely be a relatively negligible part compared to the cost of the pubdata. At the end of the execution, the bootloader will provide a list of all the L2ToL1 logs as well as the messages in this block to the L1Messenger (this will be provided by the operator in the memory of the bootloader). The L1Messenger checks that the rolling hash from the provided logs is the same as in the chainedLogsHash and calculate the merkle tree of the provided messages. Right now, we always build the Merkle tree of size 2048, but we charge the user as if the tree was built dynamically based on the number of leaves in there. The implementation of the dynamic tree has been postponed until the later upgrades. Long L2L1 messages & bytecodes Before, the fact that the correct preimages for L2L1 messages as bytecodes were provided was checked on the L1 side. Now, it will be done on L2. If the user wants to send an L2L1 message, its preimage is appended to the messages rolling hash too chainedMessagesHash = keccak256(chainedMessagesHash, keccak256(message)). A very similar approach for bytecodes is used, where their rolling hash is calculated and then the preimages are provided at the end of the batch to form the full pubdata for the batch. Note, that in for backward compatibility, just like before any long message or bytecode is accompanied by the corresponding user L2L1 log. Using system L2L1 logs vs the user logs The content of the L2L1 logs by the L1Messenger will go to the blob of EIP4844. Meaning, that all the data that belongs to the tree by L1Messengers L2L1 logs should not be needed during block commitment. Also, note that in the future we will remove the calculation of the Merkle root of the built-in L2L1 messages. The only places where the built-in L2L1 messaging should continue to be used: Logs by SystemContext (they are needed on commit to check the previous block hash). Logs by L1Messenger for the merkle root of the L2L1 tree as well as the hash of the totalPubdata. chainedPriorityTxsHash and numberOfLayer1Txs from the bootloader (read more about it below). Obtaining txNumberInBlock To have the same log format, the txNumberInBlock must be obtained. While it is internally counted in the VM, there is currently no opcode to retrieve this number. We will have a public variable txNumberInBlock in the SystemContext, which will be incremented with each new transaction and retrieve this variable from there. It is zeroed out at the end of the batch. Bootloader implementation The bootloader has a memory segment dedicated to the ABI-encoded data of the L1ToL2Messenger to perform the publishPubdataAndClearState call. At the end of the execution of the batch, the operator should provide the corresponding data into the bootloader memory, i.e user L2L1 logs, long messages, bytecodes, etc. After that, the call is performed to the L1Messenger system contract, that should validate the adherence of the pubdata to the required format

294.body:
At the end of the execution of the batch, the bootloader provides the L1Messenger with the preimages for the user L2L1 logs, L2L1 long messages as well as uncompressed bytecodes. It also provides with compressed state diffs as well as the original expanded state diff entries. It will check that the preimages are correct as well as the fact that the compression is correct. It will output the following three values via system logs: The root of the L2L1 log Merkle tree. It will be stored and used for proving withdrawals. The hash of the totalPubdata (i.e. the pubdata that contains the preimages above as well as packed state diffs). The hash of the state diffs provided by the operator (it later on be included in the block commitment and its will be enforced by the circuits). The totalPubdata has the following structure: First 4 bytes  the number of user L2L1 logs in the batch Then, the concatenation of packed L2L1 user logs. Next, 4 bytes  the number of long L2L1 messages in the batch. Then, the concatenation of L2L1 messages, each in the format of <4 byte length || actual_message>. Next, 4 bytes  the number of uncompressed bytecodes in the batch. Then, the concatenation of uncompressed bytecodes, each in the format of <4 byte length || actual_bytecode>. Next, 4 bytes  the length of the compressed state diffs. Then, state diffs are compressed by the spec above . With Boojum, the interface for committing batches is the following one: /// @notice Data needed to commit new batch
/// @param batchNumber Number of the committed batch
/// @param timestamp Unix timestamp denoting the start of the batch execution
/// @param indexRepeatedStorageChanges The serial number of the shortcut index that's used as a unique identifier for storage keys that were used twice or more
/// @param newStateRoot The state root of the full state tree
/// @param numberOfLayer1Txs Number of priority operations to be processed
/// @param priorityOperationsHash Hash of all priority operations from this batch
/// @param bootloaderHeapInitialContentsHash Hash of the initial contents of the bootloader heap. In practice it serves as the commitment to the transactions in the batch.
/// @param eventsQueueStateHash Hash of the events queue state. In practice it serves as the commitment to the events in the batch.
/// @param systemLogs concatenation of all L2 -> L1 system logs in the batch
/// @param totalL2ToL1Pubdata Total pubdata committed to as part of bootloader run. Contents are: l2Tol1Logs <> l2Tol1Messages <> publishedBytecodes <> stateDiffs
struct CommitBatchInfo { uint64 batchNumber; uint64 timestamp; uint64 indexRepeatedStorageChanges; bytes32 newStateRoot; uint256 numberOfLayer1Txs; bytes32 priorityOperationsHash; bytes32 bootloaderHeapInitialContentsHash; bytes32 eventsQueueStateHash; bytes systemLogs; bytes totalL2ToL1Pubdata;
}

