We introduced modularity into our contracts to support multiple DA layers, to support Validium and Rollup modes more easily, and to enable settlement via the Gateway The contracts for the rollup case The general architecture Background Pubdata  information published by the ZK Chain that can be used to reconstruct its state; it consists of L2L1 logs, L2L1 messages, contract bytecodes, and compressed state diffs. struct PubdataInput { pub(crate) user_logs: Vec<L1MessengerL2ToL1Log>, pub(crate) l2_to_l1_messages: Vec<Vec<u8>>, pub(crate) published_bytecodes: Vec<Vec<u8>>, pub(crate) state_diffs: Vec<StateDiffRecord>,
} The current version of ZK Chains supports the following Data Availability commitment schemes: EMPTY_NO_DA (Validium) No on-chain DA enforcement: all commitments are bytes32(0). PUBDATA_KECCAK256 Commitment = keccak256(uncompressedStateDiffHash || keccak256(pubdata)) Suitable for calldata or external DA layers that can verify a simple keccak-based proof. BLOBS_AND_PUBDATA_KECCAK256 Includes EIP-4844 blobs. Commitment = keccak256( uncompressedStateDiffHash || keccak256(pubdata) || uint8(blobLinearHashes.length) || blobLinearHashes
) NONE A placeholder for no scheme (should never be chosen). This means that a separate solution like AvailDA, EigenDA, Celestia, etc. could be used to store the pubdata. Each DA layer provides an inclusion proof of our pubdata in its storage, and that proof can later be verified on Ethereum. This gives stronger guarantees than No DA Validium, but lower fees than Blobs when Ethereum usage grows. This allows for a general-purpose solution that ensures DA consistency and verifiability, on top of which we build what partners needon-chain games, DEXes, and more: Validium with Abstract DA .

310.body:
Let's see an example of how the approach above works in rollup DA validators. Rollup use case of L2DAValidator library RollupUsecaseL2DAValidator.png Let's consider BLOBS_AND_PUBDATA_KECCAK256 commitment scheme. This is the one that's being used in default RollupL1DAValidator. In this case, the following will happen: L2DAValidator library accepts the preimages for the data to publish as well as their compressed format. After verifying the compression, it forms the _totalPubdata bytes array, which represents the entire blob of data that should be published to L1. It calls the PubdataChunkPublisher system contract to split this pubdata into multiple "chunks" of size 4096 * 31 bytes and return the keccak256 hash of those, These will be the blobHash of from the section before. To give the flexibility of checking different DA, we send the following data to L1: l2DAValidatorOutputHash that was returned by L2DAValidator library. This hash includes uncompressedStateDiffHash, pubdata, the number of blobs, and blobLinearHashes. This hash, alongside the _operatorDAInput will be provided to L1DAValidator (RollupL1DAValidator.sol is the one that accepts BLOBS_AND_PUBDATA_KECCAK256, for example). _l2DACommitmentScheme that denotes the commitment scheme that was used. In the case we're looking into, it's the BLOBS_AND_PUBDATA_KECCAK256. RollupL1DAValidator When committing the batch, the operator will provide the _operatorDAInput and _l2DAValidatorOutputHash. Using these values, RollupL1DAValidator parses the input that the L2 DA validator has provided to it into stateDiffHash, fullPubdataHash, blobsLinearHashes, blobsProvided, l1DaInput. This l1DaInput will be used to prove that the pubdata was indeed provided in this batch. The first byte of the l1DaInput denotes which way of pubdata publishing was used: calldata or blobs. In case it is calldata it will be just checked that the provided calldata matches the hash of the fullPubdataHash that was sent by the L2 counterpart. Note that calldata may still contain the blob information as we typically start generating proofs before we know which way of calldata will be used. Note that in case the calldata is used for DA, we do not verify the blobCommitments as the presence of the correct pubdata has been verified already. In case it is blobs, we need to construct the blobCommitments correctly for each of the blob of data. For each of the blobs the operator provides so called _commitment that consists of the following packed structure: opening point (16 bytes) || claimed value (32 bytes) || commitment (48 bytes) || proof (48 bytes). The verification of the _commitment can be summarized in the following snippet: // The opening point is passed as 16 bytes as that is what our circuits expect and use when verifying the new batch commitment
// PUBDATA_COMMITMENT_SIZE = 144 bytes
pubdata_commitments <- [opening point (16 bytes) || claimed value (32 bytes) || commitment (48 bytes) || proof (48 bytes)] from calldata
opening_point = bytes32(pubdata_commitments[:16])
versioned_hash <- from BLOBHASH opcode // Given that we needed to pad the opening point for the precompile, append the data after.
point_eval_input = versioned_hash || opening_point || pubdata_commitments[16: PUBDATA_COMMITMENT_SIZE] // this part handles the following:
// verify versioned_hash == hash(commitment)
// verify P(z) = y
res <- point_valuation_precompile(point_eval_input) assert uint256(res[32:]) == BLS_MODULUS The final blobCommitment is calculated as the hash between the blobVersionedHash, opening point and the claimed value. The zero knowledge circuits will verify that the opening point and the claimed value were calculated correctly and correspond to the data that was hashed under the blobHash.

