We will implement the calculation of the Merkle root of the L2L1 messages via a system contract as part of the L1Messenger. Basically, whenever a new user-emitted log that needs to be Merklized is created, the L1Messenger contract will append it to its rolling hash and then, at the end of the batch during the formation of the blob, it will receive the original preimages from the operator, verify their consistency, and send those to the L2DAValidator library to facilitate the DA protocol. We will now refer to the logs that are created by users and Merklized as user logs, and the logs that are emitted natively by the VM as system logs. Here is a short comparison table for better understanding: System logs User logs Emitted by VM via an opcode. VM knows nothing about them. Consistency and correctness are enforced by the verifier on L1 (i.e. their hash is part of the block commitment). Consistency and correctness is enforced by the L1Messenger system contract. The correctness of the behavior of the L1Messenger is enforced implicitly by the prover in the sense that it proves the correctness of the execution overall. We dont calculate their Merkle root. We calculate their Merkle root on the L1Messenger system contract. There is a constant small number of these logs. We can have as many as possible as long as the commitBatches function on L1 remains executable (it is the job of the operator to ensure that only such transactions are selected). In EIP-4844 they will remain part of the calldata. In EIP-4844 they will become part of the blobs. Backwards-compatibility Note that to maintain a unified interface with the previous version of the protocol, the leaves of the Merkle tree will have to maintain the following structure: struct L2Log { uint8 l2ShardId; bool isService; uint16 txNumberInBlock; address sender; bytes32 key; bytes32 value;
} The leaf will look as follows: bytes32 hashedLog = keccak256( abi.encodePacked(_log.l2ShardId, _log.isService, _log.txNumberInBlock, _log.sender, _log.key, _log.value)
); keccak256 will continue being the function for the Merkle tree. To put it shortly, the proofs for L2L1 log inclusion will continue to have exactly the same format as they did in the pre-Boojum system, which avoids breaking changes for SDKs and bridges alike. Implementation of L1Messenger The L1Messenger contract will maintain a rolling hash of all the L2ToL1 logs chainedLogsHash as well as the rolling hash of messages chainedMessagesHash. Whenever a contract wants to send an L2L1 log, the following operation will be applied : chainedLogsHash = keccak256(chainedLogsHash, hashedLog) L2L1 logs have the same 88-byte format as in the current version of ZKsync. Note that the user is charged for the future computation needed to calculate the final Merkle root. It is roughly 4 higher than the cost to calculate the hash of the leaf, since the eventual tree might be 4 the number of nodes. In any case, this will likely be a relatively negligible part compared to the cost of the pubdata. At the end of the execution, the bootloader will provide a list of all the L2ToL1 logs (this will be provided by the operator in the memory of the bootloader). The L1Messenger checks that the rolling hash from the provided logs is the same as in the chainedLogsHash and calculates the Merkle tree of the provided messages. Right now, we always build the Merkle tree of size 16384, but we charge the user as if the tree were built dynamically based on the number of leaves. The implementation of the dynamic tree has been postponed until later upgrades. Note that, unlike most other parts of pubdata, the user L2L1 must always be validated by the trusted L1Messenger system contract. If we moved this responsibility to L2DAValidator library it would be possible for a malicious operator to provide incorrect data and forge transactions out of names of certain users. Long L2L1 messages & bytecodes If the user wants to send an L2L1 message, its preimage is appended to the messages rolling hash to: chainedMessagesHash = keccak256(abi.encode(chainedMessagesHash, hash)); A very similar approach for bytecodes is used, where their rolling hash is calculated and then the preimages are provided at the end of the batch to form the full pubdata for the batch. Note that for backward compatibility, just like before, any long message or bytecode is accompanied by the corresponding user L2L1 log. Using system L2L1 logs vs the user logs The content of the L2L1 logs by the L1Messenger will go to the blob of EIP-4844. Meaning that all the data that belongs to the tree by L1Messengers L2L1 logs should not be needed during block commitment. Also, note that in the future we will remove the calculation of the Merkle root of the built-in L2L1 messages. The only places where the built-in L2L1 messaging should continue to be used: Logs by SystemContext (they are needed on commit to check the previous block hash). Logs by L1Messenger for the Merkle root of the L2L1 tree as well as the data needed for L1DAValidator. chainedPriorityTxsHash and numberOfLayer1Txs from the bootloader (read more about it below). Obtaining txNumberInBlock To have the same log format, the txNumberInBlock must be obtained. While it is internally counted in the VM, there is currently no opcode to retrieve this number. We will have a public variable txNumberInBlock in the SystemContext, which will be incremented with each new transaction and from which it can be retrieved. It is zeroed out at the end of the batch. Bootloader implementation The bootloader has a memory segment dedicated to the ABI-encoded data of the L1ToL2Messenger to perform the publishPubdataAndClearState call. At the end of the execution of the batch, the operator should provide the corresponding data in the bootloader memory, i.e., user L2L1 logs, long messages, bytecodes, etc. After that, the call is performed to the L1Messenger system contract, which would call the L2DAValidator library to check the adherence of the pubdata to the specified format.

316.body:
The totalPubdata has the following structure: First 4 bytes  the number of user L2L1 logs in the batch. Then, the concatenation of packed L2L1 user logs. Next, 4 bytes  the number of long L2L1 messages in the batch. Then, the concatenation of L2L1 messages, each in the format <4 byte length || actual_message>. Next, 4 bytes  the number of uncompressed bytecodes in the batch. Then, the concatenation of uncompressed bytecodes, each in the format <4 byte length || actual_bytecode>. Next, 4 bytes  the length of the compressed state diffs. Then, state diffs are compressed by the spec above . The interface for committing batches is the following: /// @notice Data needed to commit new batch
/// @param batchNumber Number of the committed batch
/// @param timestamp Unix timestamp denoting the start of the batch execution
/// @param indexRepeatedStorageChanges The serial number of the shortcut index that's used as a unique identifier for storage keys that were used twice or more
/// @param newStateRoot The state root of the full state tree
/// @param numberOfLayer1Txs Number of priority operations to be processed
/// @param priorityOperationsHash Hash of all priority operations from this batch
/// @param bootloaderHeapInitialContentsHash Hash of the initial contents of the bootloader heap. In practice it serves as the commitment to the transactions in the batch.
/// @param eventsQueueStateHash Hash of the events queue state. In practice it serves as the commitment to the events in the batch.
/// @param systemLogs Concatenation of all L2L1 system logs in the batch
/// @param totalL2ToL1Pubdata Total pubdata committed to as part of bootloader run. Contents are: l2Tol1Logs <> l2Tol1Messages <> publishedBytecodes <> stateDiffs
