} Every type consists of a Variable (the number inside Variable is just the index): pub struct Variable(pub(crate) u64); which is represented in the current Field. Variable is quite diverse, and to have "good" alignment and size we manually do encoding management to be able to represent it as both copyable variable or witness. The implementation of this circuit type itself is similar. We can also divide them into classes as main and dependent: Such type like U8-U512 decoding inside functions to Num for using them in logical operations. As mentioned above, the property of these types is to perform logical operations and allocate witnesses. Let's demonstrate this in a Boolean example: impl<F: SmallField> CSAllocatable<F> for Boolean<F> { type Witness = bool; fn placeholder_witness() -> Self::Witness { false } #[inline(always)] fn allocate_without_value<CS: ConstraintSystem<F>>(cs: &mut CS) -> Self { let var = cs.alloc_variable_without_value(); Self::from_variable_checked(cs, var) } fn allocate<CS: ConstraintSystem<F>>(cs: &mut CS, witness: Self::Witness) -> Self { let var = cs.alloc_single_variable_from_witness(F::from_u64_unchecked(witness as u64)); Self::from_variable_checked(cs, var) }
} As you see, you can allocate both with and without witnesses.

