One of the most important gadgets in our system is queue. It helps us to send data between circuits. Here is the quick explanation how it works: Struct CircuitQueue{ head: HashState, tail: HashState, length: UInt32, witness: VecDeque<Witness>,
} The structure consists of head and tail commitments that basically are rolling hashes. Also, it has a length of the queue. These three fields are allocated inside the constraint system. Also, there is a witness, that keeps actual values that are now stored in the queue. And here is the main functions: fn push(&mut self, value: Element) { // increment length // head - hash(head, value) // witness.push_back(value.witness)
} fn pop(&mut self) -> Element { // check length > 0 // decrement length // value = witness.pop_front() // tail = hash(tail, value) // return value
} fn final_check(&self) -> Element { // check that length == 0 // check that head == tail
} So the key point, of how the queue proofs that popped elements are the same as pushed ones, is equality of rolling hashes that stored in fields head and tail. Also, we check that we cant pop an element before it was pushed. This is done by checking that length >= 0. Very important is making the final_check that basically checks the equality of two hashes. So if the queue is never empty, and we havent checked the equality of head and tail in the end, we also havent proven that the elements we popped are correct. For now, we use poseidon2 hash. Here is the link to queue implementations: CircuitQueue FullStateCircuitQueue The difference is that we actually compute and store a hash inside CircuitQueue during push and pop operations. But in FullStateCircuitQueue our head and tail are just states of sponges. So instead of computing a full hash, we just absorb a pushed (popped) element.

